#include <stdio.h>
#include <limits.h>

#define N 105
#define M 1005
#define INF 0x3f3f3f3f

int n, m, s, t, f;
int a[M][5], d[N][N], c[N][N], dis[N], pre[N], vis[N];

void init() {
    for (int i = 0; i <= n; i++) {
        for (int j = 0; j <= n; j++) {
            d[i][j] = INF;
            c[i][j] = 0;
        }
    }
}

void add(int u, int v, int w) {
    c[u][v] = w;
    d[u][v] = w;
}

void add_edge(int u, int v, int w) {
    add(u, v, w);
    add(v, u, 0);
}

int min(int a, int b) {
    return a < b ? a : b;
}

int spfa() {
    for (int i = 0; i <= n; i++) {
        dis[i] = INF;
        vis[i] = 0;
    }
    dis[s] = 0;
    vis[s] = 1;
    int q[N], h = 0, t = 0;
    q[t++] = s;
    while (h < t) {
        int u = q[h++];
        vis[u] = 0;
        for (int v = 0; v <= n; v++) {
            if (c[u][v] && dis[v] > dis[u] + c[u][v]) {
                dis[v] = dis[u] + c[u][v];
                pre[v] = u;
                if (!vis[v]) {
                    vis[v] = 1;
                    q[t++] = v;
                }
            }
        }
    }
    return dis[t] <= f;
}

int main() {
    scanf("%d%d%d%d%d", &n, &m, &s, &t, &f);
    init();
    for (int i = 1; i <= m; i++) {
        int u, v, a, b, d;
        scanf("%d%d%d%d%d", &u, &v, &a, &b, &d);
        if (a < b) {
            add_edge(u, v, a * d);
            add_edge(u, v, (d + 1) * b);
        } else {
            add_edge(u, v, a * d + (f - d) * b);
        }
    }
    int ans = 0;
    while (spfa()) {
        int u = t;
        while (u != s) {
            int v = pre[u];
            c[v][u] = 0;
            c[u][v] = INF;
            f -= d[v][u];
            u = v;
        }
        ans += dis[t];
    }
    if (f > 0) {
        printf("Impossible\n");
    } else {
        printf("%d\n", ans);
    }
    return 0;
}
